import "../StyleComponent/Style.css"
export default class GlassApp extends Component {
  render() {
    return (
      <div className='backgroundImg'>
         <div className="container-fluid header">
          <p  className='text-white'>TRY GLASSES APP ONLINE</p>
         </div>
          <div className="content">
            <div className="model"><img src="" alt="" /><img src="" alt="" /></div>
            <div className="glassOptions"><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /><img src="" alt="" /></div>
          </div>
      </div>
    )
  }
}
